pragma solidity ^0.5.0;

import "openzeppelin-solidity/contracts/ownership/Ownable.sol";

contract MarketPlaceOld is Ownable {
  // store owners
  struct Storeowner {
    uint balance;
    uint storeOwnersPointer; // points to a row on the storeOwners
    // build a table of Storefront keys with a delete capability
    string[] storefrontKeys;
    mapping(string => uint) storefrontKeyPointers;
  }
  mapping(address => Storeowner) public storeOwners;
  address[] public storeOwnerList;

  // storefront managed by store owners
  struct Storefront {
    uint storefrontsPointer; // points to a row on the storefronts;
    address storeOwner;
  }
  mapping(string => Storefront) public storefronts;
  string[] public storefrontList;

  // product managed by store owenrs
  struct Product {
    string name;
    uint price;
    uint totalItems;
    uint sales;
    bool isOpen;
    uint productsPointer;
  }
  mapping(string => Product) public products;


  modifier notStoreOwner(address _storeOwner) {
    require(!isStoreOwner(_storeOwner), "caller is the store owner.");
    _;
  }

  modifier onlyStoreOwner(address _storeOwner) {
    require(isStoreOwner(_storeOwner), "caller is not the store owner.");
    _;
  }

  modifier notStorefront(string memory _name) {
    require(!isStorefront(_name), "name is the storefront.");
    _;
  }

  modifier onlyStorefront(string memory _name) {
    require(isStorefront(_name), "name is not the storefront");
    _;
  }


  event LogNewStoreOwner(address indexed newStoreOwner);
  event LogNewStorefront(address indexed storeOwner, string name);

  function createStoreOwner(address _newStoreOwner) public onlyOwner notStoreOwner(_newStoreOwner) {
    storeOwners[_newStoreOwner].storeOwnersPointer = storeOwnerList.push(_newStoreOwner) - 1;
    emit LogNewStoreOwner(_newStoreOwner);
  }

  function createStorefront(string memory _newName) public onlyStoreOwner(msg.sender) notStorefront(_newName) {
    storefronts[_newName].storefrontsPointer = storefrontList.push(_newName) - 1;
    storefronts[_newName].storeOwner = msg.sender;
    // also maintain a list of Storefront that refer to the Storeowner
    storeOwners[msg.sender].storefrontKeyPointers[_newName] = storeOwners[msg.sender].storefrontKeys.push(_newName) - 1;
    emit LogNewStorefront(msg.sender, _newName);
  }

  function isStoreOwner(address _storeOwner) public view returns(bool) {
    if (storeOwnerList.length == 0) return false;
    return storeOwnerList[storeOwners[_storeOwner].storeOwnersPointer] == _storeOwner;
  }

  function getStoreOwnerCount() public view returns(uint) {
    return storeOwnerList.length;
  }

  function getStorefrontCountFromStoreOwner(address _storeOwner) public view onlyStoreOwner(_storeOwner) returns(uint) {
    return storeOwners[_storeOwner].storefrontKeys.length;
  }

  function getStorefrontFromStoreOwner(address _storeOwner, uint _index) 
    public 
    view 
    onlyStoreOwner(_storeOwner) 
    returns(string memory name, uint storefrontsPointer, address storeOwner) 
  {
    name = storeOwners[_storeOwner].storefrontKeys[_index];
    (storefrontsPointer, storeOwner) = getStorefront(name);
  }

  function getStorefrontCount() public view returns(uint) {
    return storefrontList.length;
  }

  function getStorefront(string memory _name) public view returns(uint storefrontsPointer, address storeOwner) {
    storefrontsPointer = storefronts[_name].storefrontsPointer;
    storeOwner = storefronts[_name].storeOwner;
  }

  function isStorefront(string memory _name) public view returns(bool) {
    if (storefrontList.length == 0) return false;
    return compareStrings(storefrontList[storefronts[_name].storefrontsPointer], _name);
  }

  function compareStrings(string memory _a, string memory _b) internal pure returns(bool) {
    return keccak256(abi.encodePacked(_a)) == keccak256(abi.encodePacked(_b));
  }

}
